import styled from "styled-components";
import { mobile } from "../responsive";
import instaBatin1 from "../assets/instaBatin1.jpeg";
import bg02 from "../assets/bg02.png";
import bg03 from "../assets/bg03.png";

const Container = styled.div`
  width: 100vw;
  height: 100vh;
  background: linear-gradient(
      rgba(255, 255, 255, 0.5),
      rgba(255, 255, 255, 0.5)
    ),
    url(${bg03}) center;
      center;
  background-size: cover;
  display: flex;
  align-items: center;
  justify-content: center;
`;

const Wrapper = styled.div`
  width: 40%;
  padding: 20px;
  background-color: white;
  ${mobile({ width: "75%" })}
`;

const Title = styled.h1`
  font-size: 24px;
  font-weight: 300;
`;

const Form = styled.form`
  display: flex;
  flex-direction: column;
`;

const Input = styled.input`
  flex: 1;
  min-width: 40%;
  margin: 20px 10px 0px 0px;
  padding: 10px;
`;

const Agreement = styled.span`
  font-size: 12px;
  margin: 20px 0px;
`;

const Button = styled.button`
  width: 40%;
  border: none;
  padding: 15px 20px;
  background-color: #669ed1;
  color: white;
  cursor: pointer;
`;

const Register = () => {
  return (
    <Container>
      <Wrapper>
        <Title>Hesap Oluştur</Title>
        <Form>
          <Input placeholder="Kullanıcı Adı" />
          <Input placeholder="email" />
          <div>
            <Input placeholder="Şifre" />
            <Input
              style={{ marginRight: 0 }}
              placeholder="Şifreyi Tekrar Gir"
            />
          </div>

          <Agreement>
            Kişisel verilerimin <b>GİZLİLİK POLİTİKASI</b>'na uygun olarak
            işlenmesine onay veriyorum
          </Agreement>
          <Button>Oluştur</Button>
        </Form>
      </Wrapper>
    </Container>
  );
};

export default Register;
